// SPDX-License-Identifier: MIT
// KANJIDROPERC721A.sol
pragma solidity ^0.8.6;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/common/ERC2981.sol";
import "@openzeppelin/contracts/utils/structs/BitMaps.sol";

import "erc721a/contracts/ERC721A.sol";
import "./lib/PaymentSplitter.sol";
import "./lib/MerkleProof.sol";
import "./lib/CurrencyTransferLib.sol";

contract KANJIDROPERC721A is ERC721A, Ownable, ReentrancyGuard, ERC2981, PaymentSplitter {

    using Strings for uint256;
    using BitMaps for BitMaps.BitMap;

    /*///////////////////////////////////////////////////////////////
                                Structure
    //////////////////////////////////////////////////////////////*/
    struct ClaimCondition {
        uint256 startTimestamp;
        uint256 endTimestamp;
        uint256 maxClaimableSupply;
        uint256 supplyClaimed;
        uint256 quantityLimitPerTransaction;
        uint256 waitTimeInSecondsBetweenClaims;
        uint256 pricePerToken;
        bytes32 merkleRoot;
        address currency;
    }

    struct ClaimConditionList {
        uint256 currentStartId;
        uint256 count;
        mapping(uint256 => ClaimCondition) phases;
        mapping(uint256 => mapping(address => uint256)) limitLastClaimTimestamp;
        mapping(uint256 => BitMaps.BitMap) limitMerkleProofClaim;
    }

    /*///////////////////////////////////////////////////////////////
                                Global Variable
    //////////////////////////////////////////////////////////////*/

    /// @dev Max bps in the system.
    uint256 private constant MAX_BPS = 10000;

    /// @dev The next token ID of the NFT to "lazy mint".
    uint256 public nextTokenIdToMint;

    /// @dev The next token ID of the NFT that can be claimed.
    uint256 public nextTokenIdToClaim;

    /// @dev The max number of NFTs a wallet can claim.
    uint256 public maxWalletClaimCount;

    /// @dev Global max total supply of NFTs.
    uint256 public maxTotalSupply;

    /// @dev The amount % of receiver fees of KANJI (10000 = 100 %) 
    uint256 private kanjiFeesBeneficiaries;

    /// @dev Version of contract
    uint256 public constant VERSION = 1;

    /// @dev Max total mint for customer only
    uint256 public immutable maxSupply;

    /// @dev Largest tokenId of each batch of tokens with the same baseURI
    uint256[] public baseURIIndices;

    /// @dev The set of all claim conditions, at any given moment.
    ClaimConditionList private claimCondition;

    /*///////////////////////////////////////////////////////////////
                                Mappings
    //////////////////////////////////////////////////////////////*/

    /**
     *  @dev Mapping from 'Largest tokenId of a batch of tokens with the same baseURI'
     *       to base URI for the respective batch of tokens.
     **/
    mapping(uint256 => string) private baseURI;

    /**
     *  @dev Mapping from 'Largest tokenId of a batch of 'delayed-reveal' tokens with
     *       the same baseURI' to encrypted base URI for the respective batch of tokens.
     **/
    mapping(uint256 => bytes) public encryptedBaseURI;

    /// @dev Mapping from address => total number of NFTs a wallet has claimed.
    mapping(address => uint256) public walletClaimCount;

    /// @dev open sea contract level metadata
    string public _contractURI;
    /// @dev pause the transfer only by owner
    bool public paused;
    /// @dev INTERFACE SUPPORTED
    bytes4 private constant _INTERFACE_ID_ERC2981 = 0x2a55205a;
    bytes4 private constant _INTERFACE_ID_ERC165 = 0x01ffc9a7;

    /// @dev The address of receiver fees of beneficiaries BRAND for each claim
    address[] private payeesBeneficiaries;
    /// @dev The amount % of receiver fees of beneficiaries BRAND (10000 = 100 %) for each claim
    uint256[] private sharesBeneficiaries;

    /// @dev The address of receiver fees of KANJI
    address private kanjiAddressFees;

    /// @dev Type of contract
    bytes32 public constant MODULE_TYPE = bytes32("KANJIDROPERC721A");


    event Mints(
        uint256 id,
        address minter,
        uint256 quantity
    );

    event Pause(
        bool paused
    );

    event TokensClaimed(
        uint256 claimConditionIndex,
        address claimer,
        address receiver,
        uint256 startTokenId,
        uint256 quantityClaimed
    );

    /// @dev Emitted when tokens are lazy minted.
    event TokensLazyMinted(
        uint256 startTokenId,
        uint256 endTokenId,
        string baseURI,
        bytes encryptedBaseURI
    );

    /// @dev Emitted when the URI for a batch of 'delayed-reveal' NFTs is revealed.
    event NFTRevealed(
        uint256 endTokenId,
        string revealedURI
    );

    /// @dev Emitted when the wallet claim count for an address is updated.
    event WalletClaimCountUpdated(
        address wallet,
        uint256 count
    );

    /// @dev Emitted when new claim conditions are set.
    event ClaimConditionsUpdated(ClaimCondition[] claimConditions);

    /// @dev Emitted when the global max supply of tokens is updated.
    event MaxTotalSupplyUpdated(uint256 maxTotalSupply);

    /// @dev Emitted when the global max wallet claim count is updated.
    event MaxWalletClaimCountUpdated(uint256 count);

    error NothingToReveal(uint256 encryptedURILength);

    error InvalidIndex(uint256 index, uint256 baseURIIndicesLength);

    error StartTimeStamp(uint256 index, uint256 lastConditionStartTimestamp, uint256 startTimestamp);

    error MaxSupply(uint256 index, uint256 supplyClaimedAlready, uint256 maxClaimableSupply);

    error PriceNotGood(uint256 value, uint256 totalPrice);

    error InvalidPriceOrCurrency(address currency, address phaseCurrency, uint256 pricePerToken, uint256 phasePricePerToken);

    error InvalidQuantityClaimed(uint256 quantity, bool verifyMaxQuantityPerTransaction, uint256 quantityLimitPerTransaction);

    error ExceedMaxMintSupply(uint256 quantity, uint256 supplyClaimed, uint256 maxClaimableSupply);

    error NotEnoughMintedTokens(uint256 quantity, uint256 nextTokenIdToClaim, uint256 nextTokenIdToMint);

    error ExceedMaxTotalSupply(uint256 quantity, uint256 maxTotalSupply, uint256 nextTokenIdToClaim);

    error ExceedClaimLimitForWallet(uint256 quantity, uint256 walletClaimCountClaimer, address claimer, uint256 maxWalletClaimCount);

    error CannotClaimYet(uint256 lastClaimTimestamp, uint256 blockTimestamp, uint256 nextValidClaimTimestamp);

    error NotInWhitelist(bool validMerkleProof);

    error ProofClaimed(uint256 conditionId, uint256 merkleProofIndex, bool limitMerkleProofClaim);

    error InvalidQuantityProof(uint256 proofMaxQuantityPerTransaction, uint256 quantity);

    error MaxTotalySupply(uint256 maxTotalSupply, uint256 nextTokenIdToMint);

    error Paused(bool paused, address owner, address ownerOfToken, uint256 startTokenId);

    constructor(
        string memory name,
        string memory symbol,
        uint96 _royaltyFeesInBips,
        address _kanjiAddressFees,
        uint256 _kanjiFeesBeneficiaries,
        address[] memory payees,
        uint256[] memory shares_,
        address[] memory _payeesBeneficiaries,
        uint256[] memory _sharesBeneficiaries,
        string memory __contractURI,
        uint256 _maxSupply
    ) PaymentSplitter(payees,shares_) ERC721A(name, symbol){
        require(payees.length > 0, "Royalty: no payees provided");
        require(payees.length == shares_.length, "Unequal number of payees/shares provided");
        uint256 totalSharesBeneficiaries;
        for (uint256 index = 0; index < _sharesBeneficiaries.length; index++) {
            totalSharesBeneficiaries += _sharesBeneficiaries[index];
        }
        totalSharesBeneficiaries+=_kanjiFeesBeneficiaries;
        require(totalSharesBeneficiaries==MAX_BPS,"Shares not equal MAX_BPS");
        maxSupply = _maxSupply;

        payeesBeneficiaries = _payeesBeneficiaries;//dispatch address of royalties platform (open sea rarible ect)
        sharesBeneficiaries = _sharesBeneficiaries;//percent of royalties platform (open sea rarible ect)

        kanjiAddressFees = _kanjiAddressFees;
        kanjiFeesBeneficiaries = _kanjiFeesBeneficiaries;

        _setDefaultRoyalty(payable(address(this)),_royaltyFeesInBips);
        _contractURI = __contractURI;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721A,ERC2981) returns (bool) {
        if(interfaceId == _INTERFACE_ID_ERC2981) {
            return true;
        }
        if(interfaceId == _INTERFACE_ID_ERC165) {
            return true;
        }
        return super.supportsInterface(interfaceId);
    } 

    /// @notice return Opensea contract level metadata
    /// @return _contractURI URI of json contract level metadatas
    function contractURI() external view returns (string memory) {
        return _contractURI;
    }

    /// @notice owner mint a reserve of tokens to specific address
    /// @param receiver receiver of mint
    /// @param quantity quantity gonna be mint
    function mintOwner(address receiver, uint256 quantity) external onlyOwner{
        require(nextTokenIdToClaim+quantity<=maxSupply,"Up to maxsupply");
        emit Mints(nextTokenIdToClaim,receiver, quantity);
        nextTokenIdToClaim += quantity;
        _safeMint(receiver, quantity);
    }

    /// @notice get token URI for metadatas token
    /// @param _tokenId id of token URI you want return
    /// @return URI uri of token
    function tokenURI(uint256 _tokenId) public view override returns (string memory) {
        for (uint256 i = 0; i < baseURIIndices.length; i += 1) {
            if (_tokenId < baseURIIndices[i]) {
                if (encryptedBaseURI[baseURIIndices[i]].length != 0) {
                    return string(abi.encodePacked(baseURI[baseURIIndices[i]], "0"));
                } else {
                    return string(abi.encodePacked(baseURI[baseURIIndices[i]], _tokenId.toString(),".json"));
                }
            }
        }
        return "";
    }

    /// @notice Prepare datas for mint tokens with base uri for tokens and optional revealable encrypted uri
    /// @param _amount quantity of token you want to prepared mint
    /// @param _baseURIForTokens real uri for your token if not _encryptedBaseURI or flask if encrypt _encryptedBaseURI exist
    /// @param _encryptedBaseURI can be empty if not revealable or contain encrypt base uri
    function lazyMint(
        uint256 _amount,
        string calldata _baseURIForTokens,
        bytes calldata _encryptedBaseURI
    ) external onlyOwner {
        uint256 startId = nextTokenIdToMint;
        uint256 baseURIIndex = startId + _amount;

        nextTokenIdToMint = baseURIIndex;
        baseURI[baseURIIndex] = _baseURIForTokens;
        baseURIIndices.push(baseURIIndex);

        if (_encryptedBaseURI.length != 0) {
            encryptedBaseURI[baseURIIndex] = _encryptedBaseURI;
        }
        emit TokensLazyMinted(startId, startId + _amount - 1, _baseURIForTokens, _encryptedBaseURI);
    }

    /// @notice Reveal real metadatas uri of tokens hided in packs
    /// @param index index of base uri value encrypted you want to reveal
    /// @param _key key to decrypt uri
    /// @return revealedURI decrypted uri of batch tokens
    function reveal(uint256 index, bytes calldata _key)
        external
        onlyOwner
        returns (string memory revealedURI)
    {
        if(index >= baseURIIndices.length)
            revert InvalidIndex({
                index: index,
                baseURIIndicesLength: baseURIIndices.length
            });

        uint256 _index = baseURIIndices[index];
        bytes memory encryptedURI = encryptedBaseURI[_index];
        if(encryptedURI.length == 0)
            revert NothingToReveal({
                encryptedURILength: encryptedURI.length
            });

        revealedURI = string(encryptDecrypt(encryptedURI, _key));

        baseURI[_index] = revealedURI;
        delete encryptedBaseURI[_index];
        emit NFTRevealed(_index, revealedURI);
        return revealedURI;
    }

    /// @notice See: https://ethereum.stackexchange.com/questions/69825/decrypt-message-on-chain
    /// @param data uri you want encrypt decrypt
    /// @param key key of array bases uri indicies
    function encryptDecrypt(bytes memory data, bytes calldata key) public pure returns (bytes memory result) {
        // Store data length on stack for later use
        uint256 length = data.length;

        // solhint-disable-next-line no-inline-assembly
        assembly {
            // Set result to free memory pointer
            result := mload(0x40)
            // Increase free memory pointer by lenght + 32
            mstore(0x40, add(add(result, length), 32))
            // Set result length
            mstore(result, length)
        }

        // Iterate over the data stepping by 32 bytes
        for (uint256 i = 0; i < length; i += 32) {
            // Generate hash of the key and offset
            bytes32 hash = keccak256(abi.encodePacked(key, i));

            bytes32 chunk;
            // solhint-disable-next-line no-inline-assembly
            assembly {
                // Read 32-bytes data chunk
                chunk := mload(add(data, add(i, 32)))
            }
            // XOR the chunk with hash
            chunk ^= hash;
            // solhint-disable-next-line no-inline-assembly
            assembly {
                // Write 32-byte encrypted chunk
                mstore(add(result, add(i, 32)), chunk)
            }
        }
    }

    /*///////////////////////////////////////////////////////////////
                            Claim logic
    //////////////////////////////////////////////////////////////*/

    /// @notice Lets an account claim NFTs.
    /// @param _receiver address wallet of receiver during a claim
    /// @param _quantity quantity of token you want to claim
    /// @param _currency currency of token claimCondition
    /// @param _pricePerToken price in wei per token for transaction
    /// @param _proofs merkle proof 
    /// @param _proofMaxQuantityPerTransaction quantity of token into merkle proof
    function claim(
        address _receiver,
        uint256 _quantity,
        address _currency,
        uint256 _pricePerToken,
        bytes32[] calldata _proofs,
        uint256 _proofMaxQuantityPerTransaction
    ) external payable nonReentrant {
        uint256 activeConditionId = getActiveClaimConditionId();
        (bool validMerkleProof, uint256 merkleProofIndex) = verifyClaimMerkleProof(
            activeConditionId,
            _msgSender(),
            _quantity,
            _proofs,
            _proofMaxQuantityPerTransaction
        );
        bool toVerifyMaxQuantityPerTransaction = _proofMaxQuantityPerTransaction == 0;
        verifyClaim(
            activeConditionId,
            _msgSender(),
            _quantity,
            _currency,
            _pricePerToken,
            toVerifyMaxQuantityPerTransaction
        );
        //Mark the claimer's use of their position in the allowlist. 
        //A spot in an allowlist an be used only once.
        if (validMerkleProof && _proofMaxQuantityPerTransaction > 0){
            claimCondition.limitMerkleProofClaim[activeConditionId].set(merkleProofIndex);
        }
        collectClaimPrice(_quantity, _currency, _pricePerToken);
        transferClaimedTokens(_receiver, activeConditionId, _quantity);
        emit TokensClaimed(activeConditionId, _msgSender(), _receiver, nextTokenIdToClaim, _quantity);
    }

    /// @notice Lets a contract owner set claim conditions.
    /// @param _phases array of new claim conditions updated
    /// @param _resetClaimEligibility reset all value of claim conditions
    function setClaimConditions(ClaimCondition[] calldata _phases, bool _resetClaimEligibility)
        external
        onlyOwner
    {

        uint256 existingStartIndex = claimCondition.currentStartId;
        uint256 existingPhaseCount = claimCondition.count;

        uint256 newStartIndex = existingStartIndex;
        if (_resetClaimEligibility) {
            newStartIndex = existingStartIndex + existingPhaseCount;
        }

        claimCondition.count = _phases.length;
        claimCondition.currentStartId = newStartIndex;

        uint256 lastConditionStartTimestamp;

        for (uint256 i = 0; i < _phases.length; i++) {
            if(i != 0 && lastConditionStartTimestamp >= _phases[i].startTimestamp)
                revert StartTimeStamp({
                    index: i,
                    lastConditionStartTimestamp : lastConditionStartTimestamp,
                    startTimestamp : _phases[i].startTimestamp
                });
            uint256 supplyClaimedAlready = claimCondition.phases[newStartIndex + i].supplyClaimed;
            if(supplyClaimedAlready > _phases[i].maxClaimableSupply)
                revert MaxSupply({
                    index: i,
                    supplyClaimedAlready : supplyClaimedAlready,
                    maxClaimableSupply : _phases[i].maxClaimableSupply
                });

            claimCondition.phases[newStartIndex + i] = _phases[i];
            claimCondition.phases[newStartIndex + i].supplyClaimed = supplyClaimedAlready;

            lastConditionStartTimestamp = _phases[i].startTimestamp;
        }

        if (_resetClaimEligibility) {
            for (uint256 i = existingStartIndex; i < newStartIndex; i++) {
                delete claimCondition.phases[i];
                delete claimCondition.limitMerkleProofClaim[i];
            }
        } else {
            if (existingPhaseCount > _phases.length) {
                for (uint256 i = _phases.length; i < existingPhaseCount; i++) {
                    delete claimCondition.phases[newStartIndex + i];
                    delete claimCondition.limitMerkleProofClaim[newStartIndex + i];
                }
            }
        }
        emit ClaimConditionsUpdated(_phases);
    }

    /// @notice Collects and distributes the primary sale value of NFTs being claimed.
    /// @param _quantityToClaim quantity user gonna be claimed
    /// @param _currency currency of token claimCondition
    /// @param _pricePerToken price in wei per token for transaction
    function collectClaimPrice(
        uint256 _quantityToClaim,
        address _currency,
        uint256 _pricePerToken
    ) internal {
        if (_pricePerToken == 0) {
            return;
        }

        uint256 totalPrice = _quantityToClaim * _pricePerToken;
        if(msg.value != totalPrice && _currency == CurrencyTransferLib.NATIVE_TOKEN)
            revert PriceNotGood({
                value: msg.value,
                totalPrice : totalPrice
            });

        if(kanjiFeesBeneficiaries!=0){
            uint256 inFee = (totalPrice * kanjiFeesBeneficiaries) / MAX_BPS;
            CurrencyTransferLib.transferCurrency(_currency, _msgSender(), kanjiAddressFees, inFee);
        }

        for (uint256 index = 0; index < payeesBeneficiaries.length; index++) {
            uint256 feeBeneficiarie = ((totalPrice) * sharesBeneficiaries[index]) / MAX_BPS;
            CurrencyTransferLib.transferCurrency(_currency, _msgSender(), payeesBeneficiaries[index], feeBeneficiarie);
        }
    }

    /// @notice Transfers the NFTs being claimed.
    /// @param _to address wallet claimer
    /// @param _conditionId current claim condition id
    /// @param _quantityBeingClaimed quantity user gonna be claimed
    function transferClaimedTokens(
        address _to,
        uint256 _conditionId,
        uint256 _quantityBeingClaimed
    ) internal {
        // Update the supply minted under mint condition.
        require(nextTokenIdToClaim + _quantityBeingClaimed<=maxSupply,"Up to maxsupply");
        claimCondition.phases[_conditionId].supplyClaimed += _quantityBeingClaimed;

        // if transfer claimed tokens is called when `to != _msgSender()`, it'd use _msgSender()'s limits.
        // behavior would be similar to `_msgSender()` mint for itself, then transfer to `_to`.
        claimCondition.limitLastClaimTimestamp[_conditionId][_msgSender()] = block.timestamp;
        walletClaimCount[_msgSender()] += _quantityBeingClaimed;

        uint256 tokenIdToClaim = nextTokenIdToClaim;

        emit Mints(tokenIdToClaim,_to, _quantityBeingClaimed);
        tokenIdToClaim += _quantityBeingClaimed;

        nextTokenIdToClaim = tokenIdToClaim;
        _safeMint(_to, _quantityBeingClaimed);
    }

    /// @notice Checks a request to claim NFTs against the active claim condition's criteria.
    /// @param _conditionId id collection where you want to claim
    /// @param _claimer address wallet of claimer
    /// @param _quantity quantity of token you want to claim
    /// @param _currency currency of token claimCondition
    /// @param _pricePerToken price in wei per token for transaction
    /// @param verifyMaxQuantityPerTransaction verify max quantity per transaction
    function verifyClaim(
        uint256 _conditionId,
        address _claimer,
        uint256 _quantity,
        address _currency,
        uint256 _pricePerToken,
        bool verifyMaxQuantityPerTransaction
    ) public view {
        ClaimCondition memory currentClaimPhase = claimCondition.phases[_conditionId];
        if(_currency != currentClaimPhase.currency || _pricePerToken != currentClaimPhase.pricePerToken)
            revert InvalidPriceOrCurrency({
                currency: _currency,
                phaseCurrency: currentClaimPhase.currency,
                pricePerToken : _pricePerToken,
                phasePricePerToken : currentClaimPhase.pricePerToken
            });
        // If we're checking for an allowlist quantity restriction, ignore the general quantity restriction.
        if(_quantity == 0 || (verifyMaxQuantityPerTransaction && _quantity > currentClaimPhase.quantityLimitPerTransaction))
            revert InvalidQuantityClaimed({
                quantity: _quantity,
                verifyMaxQuantityPerTransaction: verifyMaxQuantityPerTransaction,
                quantityLimitPerTransaction : currentClaimPhase.quantityLimitPerTransaction
            });
        if(currentClaimPhase.supplyClaimed + _quantity > currentClaimPhase.maxClaimableSupply)
            revert ExceedMaxMintSupply({
                quantity: _quantity,
                supplyClaimed: currentClaimPhase.supplyClaimed,
                maxClaimableSupply : currentClaimPhase.maxClaimableSupply
            });
        if(nextTokenIdToClaim + _quantity > nextTokenIdToMint)
            revert NotEnoughMintedTokens({
                quantity: _quantity,
                nextTokenIdToClaim: nextTokenIdToClaim,
                nextTokenIdToMint : nextTokenIdToMint
            });
        if(maxTotalSupply != 0 && nextTokenIdToClaim + _quantity > maxTotalSupply)
            revert ExceedMaxTotalSupply({
                quantity: _quantity,
                maxTotalSupply: maxTotalSupply,
                nextTokenIdToClaim : nextTokenIdToClaim
            });
        if(maxWalletClaimCount != 0 && walletClaimCount[_claimer] + _quantity > maxWalletClaimCount)
            revert ExceedClaimLimitForWallet({
                quantity: _quantity,
                walletClaimCountClaimer: walletClaimCount[_claimer],
                claimer: _claimer,
                maxWalletClaimCount : maxWalletClaimCount
            });
        (uint256 lastClaimTimestamp, uint256 nextValidClaimTimestamp) = getClaimTimestamp(_conditionId, _claimer);
        if(lastClaimTimestamp != 0 && block.timestamp < nextValidClaimTimestamp)
            revert CannotClaimYet({
                lastClaimTimestamp: lastClaimTimestamp,
                blockTimestamp: block.timestamp,
                nextValidClaimTimestamp: nextValidClaimTimestamp
            });
    }

    /// @notice Checks whether a claimer meets the claim condition's allowlist criteria.
    /// @param _conditionId id collection where you want to claim
    /// @param _claimer address wallet of claimer
    /// @param _quantity quantity of token you want to claim
    /// @param _proofs merkle proof 
    /// @param _proofMaxQuantityPerTransaction quantity of token into merkle proof
    function verifyClaimMerkleProof(
        uint256 _conditionId,
        address _claimer,
        uint256 _quantity,
        bytes32[] calldata _proofs,
        uint256 _proofMaxQuantityPerTransaction
    ) public view returns (bool validMerkleProof, uint256 merkleProofIndex) {
        ClaimCondition memory currentClaimPhase = claimCondition.phases[_conditionId];

        if (currentClaimPhase.merkleRoot != bytes32(0)) {
            (validMerkleProof, merkleProofIndex) = MerkleProofLib.verify(
                _proofs,
                currentClaimPhase.merkleRoot,
                keccak256(abi.encodePacked(_claimer, _proofMaxQuantityPerTransaction))
            );
            if(!validMerkleProof)
                revert NotInWhitelist({
                    validMerkleProof: validMerkleProof
                });
            if(claimCondition.limitMerkleProofClaim[_conditionId].get(merkleProofIndex))
                revert ProofClaimed({
                    conditionId: _conditionId,
                    merkleProofIndex: merkleProofIndex,
                    limitMerkleProofClaim: claimCondition.limitMerkleProofClaim[_conditionId].get(merkleProofIndex)
                });
            if(_proofMaxQuantityPerTransaction != 0 && _quantity > _proofMaxQuantityPerTransaction)
                revert InvalidQuantityProof({
                    proofMaxQuantityPerTransaction: _proofMaxQuantityPerTransaction,
                    quantity: _quantity
                });
        }
    }

    /// @notice Returns the amount of stored baseURIs
    /// @return length length of baseURIIndices
    function getBaseURICount() external view returns (uint256) {
        return baseURIIndices.length;
    }

    /// @notice Return current claim condition
    function getActiveClaimConditionId() public view returns (uint256) {
        for (uint256 i = claimCondition.count; i > 0; i--) {
            if (block.timestamp >= claimCondition.phases[i - 1].startTimestamp && 
            (block.timestamp <= claimCondition.phases[i - 1].endTimestamp
            ||
            claimCondition.phases[i - 1].endTimestamp == 0)) {
                return i - 1;
            }
        }
        revert("no active mint condition.");
    }

    /// @notice Return timestamp for next valid claim for only one claimer
    /// @param _conditionId id of collection you wan to get claim timestamp
    /// @param _claimer address wallet of one claimer
    function getClaimTimestamp(uint256 _conditionId, address _claimer)
        public
        view
        returns (uint256 lastClaimTimestamp, uint256 nextValidClaimTimestamp)
    {
        lastClaimTimestamp = claimCondition.limitLastClaimTimestamp[_conditionId][_claimer];

        unchecked {
            nextValidClaimTimestamp =
                lastClaimTimestamp +
                claimCondition.phases[_conditionId].waitTimeInSecondsBetweenClaims;

            if (nextValidClaimTimestamp < lastClaimTimestamp) {
                nextValidClaimTimestamp = type(uint256).max;
            }
        }
    }

    /// @notice Returns the claim condition at the given uid.
    /// @param _conditionId if of collection you want to return
    /// @return condition claim condition structure
    function getClaimConditionById(uint256 _conditionId) external view returns (ClaimCondition memory condition) {
        condition = claimCondition.phases[_conditionId];
    }

    /*///////////////////////////////////////////////////////////////
                        Setter functions
    //////////////////////////////////////////////////////////////*/

    /// @notice Lets a contract admin set a claim count for a wallet.
    /// @param _claimer address of claimer
    /// @param _count current count of claim for one wallet
    function setWalletClaimCount(address _claimer, uint256 _count) external onlyOwner {
        walletClaimCount[_claimer] = _count;
        emit WalletClaimCountUpdated(_claimer, _count);
    }

    /// @notice Lets a contract admin set a maximum number of NFTs that can be claimed by any wallet.
    /// @param _count max claim for each wallet
    function setMaxWalletClaimCount(uint256 _count) external onlyOwner {
        maxWalletClaimCount = _count;
        emit MaxWalletClaimCountUpdated(_count);
    }

    /// @notice Lets a contract admin set the global maximum supply for collection's NFTs.
    /// @param _maxTotalSupply max supply of contract
    function setMaxTotalSupply(uint256 _maxTotalSupply) external onlyOwner {
        if(_maxTotalSupply >= nextTokenIdToMint)
            revert MaxTotalySupply({
                maxTotalSupply: _maxTotalSupply,
                nextTokenIdToMint: nextTokenIdToMint
            });
        //require(_maxTotalSupply < nextTokenIdToMint, "MAX");
        maxTotalSupply = _maxTotalSupply;
        emit MaxTotalSupplyUpdated(_maxTotalSupply);
    }

    /// @notice Temporarily lock the contract
    function pause() external onlyOwner {
        paused=!paused;
        emit Pause(paused);
    }

    /// @notice Temporarily lock the contract
    /// @param from address of from transfer
    /// @param to address of to transfer
    /// @param startTokenId id of start token
    /// @param quantity quantity of transfered token
    function _beforeTokenTransfers(
        address from,
        address to,
        uint256 startTokenId,
        uint256 quantity
    ) internal virtual override(ERC721A) {
        if(paused && ownerOf(startTokenId) != owner())
            revert Paused({
                paused: paused,
                owner: owner(),
                ownerOfToken: ownerOf(startTokenId),
                startTokenId: startTokenId
            });
        super._beforeTokenTransfers(from, to, startTokenId, quantity);
    }

}

